#[derive(Debug)]
pub enum LogLevel { Debug, Info, Warn, Error,
} #[derive(Debug)]
pub struct ArgumentHelper { pub log_level: LogLevel,
} impl ArgumentHelper { pub fn parse_args(mut self, args: Vec<String>) -> ArgumentHelper { for _x in 0..args.len() { match args[_x].as_ref() { _ if args[_x] == Self::HELP_SWITCHES[0] => { self.help = true; } _ if args[_x] == Self::HELP_SWITCHES[1] => { self.help = true; } Self::LOG_LEVEL_SWITCH => { self.log_level = Self::parse_log_level(&args[_x + 1]); } &_ => {} } } self } fn parse_log_level(val: &str) -> LogLevel { match val { "debug" => LogLevel::Debug, "info" => LogLevel::Info, "warn" => LogLevel::Warn, "error" => LogLevel::Error, _ => LogLevel::Info, } }
}
